This was my vibes quote to my story today,  It didnt say who it was from but above it said "2 rules to live by"⁣⁣
⁣⁣
I thought it was fitting as today is my 43rd bday and I decided to take myself hiking for the day.⁣⁣
⁣⁣
Technically I am waiting for my good friend @parcelsavage who is coming up tomrrow morning to go on a proper hike.  But I decided to treat my self to a little no tell - motel teo nights sp I could enjoy a full weekend away with no rush.⁣⁣
⁣⁣
So after work today I drove up to NH and got in a little primer hike by myself. (Which seeing how my training as fallen off a cliff the last month or two I'm a little worried for tomorrow lol)⁣⁣
⁣⁣
Point being I didnt wait for anybody today.  I made the descion that inwanted to do it and if was going to be solo sp be it.⁣⁣
⁣⁣
I'm stoked to hike with my friend tomorrow but I just as happy that I did this solo hike today! ⁣⁣
⁣⁣
Now I'm going to treat myself to a big as ice cream! ⁣⁣
⁣⁣
I think those are two pretty good rules to start to try and live by going into my 43rd year on this earth! ⁣⁣
⁣
Btw I actually asked someone to take this pic for me. Which is way out of my comfort zone!  #smallwin⁣
